try:
        json_data = json.loads(json_str)
    except json.JSONDecodeError:
        return {}

    result = {}
    pattern = re.compile(r"https?:\/\/(www\.)?[-a-zA-Z0-9@:%._\+~#=]{1,256}\.[a-zA-Z0-9()]{1,6}\b([-a-zA-Z0-9()@:%_\+.~#?&//=]*)")
    for match in pattern.findall(json_str):
        result[match] = result.get(match, 0) + 1
    sorted_result = sorted(result.items(), key=lambda x: x[1], reverse=True)
    top_urls = {key: value for key, value in sorted_result[:top_n]}
    return top_urls

