json_dict = json.loads(json_str)
    result = Counter(re.findall(r"http[s]?://(?:[a-zA-Z]|[0-9]|[$-_@.&+]|[!*'(),]|"
                                 r"#|[\t\r\n]|\\|[%\{]|[&])+(?!\s*\")", json_dict['website']))

    # Check for invalid URLs or duplicates
    for url in result:
        if re.search(r"(https?://)?([-a-zA-Z0-9@:%._+~#?&//=])+", url) is None:
            result.pop(url)
        elif url.count('.') < 2:
            result.pop(url)

    return dict(Counter(result).most_common(top_n))

json_dict = json.loads(json_str)
    url = r"https?:\/\/(?:(?:[a-zA-Z0-9]+\.)+(?:[a-zA-Z]{2,}?))"
    regex = re.compile(url)
    counter = Counter()
    for item in json_dict.values():
        url = regex.findall(str(item))
        if len(url) > 0:
            counter.update(Counter(url))

    return dict(counter.most_common(top_n))

