url_regex = re.compile(r"https?://(www\.)?[a-zA-Z0-9\-]+\.[a-z]+")
    result = Counter()
    json_dict = json.loads(json_str)
    for key, value in json_dict.items():
        if type(value) == str:
            urls = url_regex.findall(value)
            for url in urls:
                result[url] += 1

    return result
